import React, { Component } from "react";
//import Logo from "./res/rallye2020.png";

class YearEdition extends Component {
	render() {
		const images = require.context('../../../assets/img', true);
		let img = images('./res/rallye' + this.props.year + ".png");
		return(
			<div class="year-edition">
				<p>{this.props.year}</p>
				<img src={img} alt="Screenshot du site du rallye" />
	        </div>
		);
	}
}

export default YearEdition;
